# Create launcher NARROW BAND
DESKTOP_FILE="$USER_HOME/Desktop/HB9IIU NB Monitor"
cat > "$DESKTOP_FILE" <<EOF
[Desktop Entry]
Version=1.0
Type=Application
Name=HB9IIU NB Monitor
Comment=HB9IIU Aligner
Exec=$APP_DIR/bin/python3 $APP_DIR/NBfinal.py
Icon=$ICON_PNG
Terminal=false
Categories=Utility;
EOF

# Make launcher executable
chmod +x "$DESKTOP_FILE"
if command -v gio >/dev/null 2>&1; then
  gio set "$DESKTOP_FILE" "metadata::trusted" true || true
fi

# Refresh PCManFM if running
if pgrep -x pcmanfm >/dev/null 2>&1; then
  pcmanfm --reconfigure >/dev/null 2>&1 || true
fi

echo "✅ Launcher: $DESKTOP_FILE"
echo "🖼  Icon: $ICON_PNG"

